import React, {useEffect, useState} from "react";
import styles from './TableHeader.module.css';

const TableHeader = () => {
    const [tableData, setTableData] = useState([]);

    // Fetch data from the REST controller
    useEffect(() => {
        fetch('http://localhost:8081/api/tickers') // Replace with your actual API endpoint
            .then((response) => response.json())
            .then((data) => {
                setTableData(data.content || []); // Assuming your API returns an array of objects
            })
            .catch((error) => {
                console.error('Error fetching data:', error);
            });
    }, []);

    const headers = [
        {id: 'ticker', label: 'Ticker'},
        {id: 'max', label: 'Max'},
        {id: 'min', label: 'Min'},
        {id: 'date', label: 'Date'},
        {id: 'lastPrice', label: 'Price of last\ntransaction', isLast: true}
    ];

    return (
        <div className={styles.tableWrapper}>
            {/* Table Header */}
            <div className={styles.tableHeader}>
                <div className={styles.headerRow} role="row">
                    {headers.map((header) => (
                        <div
                            key={header.id}
                            className={header.isLast ? styles.lastPriceCell : styles.headerCell}
                            role="columnheader"
                            tabIndex={0}
                        >
                            {header.label}
                        </div>
                    ))}
                </div>
            </div>

            {/* Table Body */}
            <div className={styles.tableBody}>
                {tableData.length === 0 ? (
                    <div>No data available</div>
                ) : (
                    tableData.map((row) => (
                        <div className={styles.row} key={row.id} role="row">
                            <div className={styles.cell} role="cell">{row.ticker}</div>
                            <div className={styles.cell} role="cell">{row.max}</div>
                            <div className={styles.cell} role="cell">{row.min}</div>
                            <div className={styles.cell} role="cell">{row.date}</div>
                            <div className={styles.lastPriceCell} role="cell">{row.lastPrice}</div>
                        </div>
                    ))
                )}
            </div>
        </div>
    )
};

export  default TableHeader;
